var saveJson = function(obj) {
	var str = JSON.stringify(obj);
	var data = encode( str );

	var blob = new Blob( [ data ], {
		type: 'application/octet-stream'
	});
	
	url = URL.createObjectURL( blob );
	var link = document.createElement( 'a' );
	link.setAttribute( 'href', url );
	link.setAttribute( 'download', 'data.json' );
	var event = document.createEvent( 'MouseEvents' );
	event.initMouseEvent( 'click', true, true, window, 1, 0, 0, 0, 0, false, false, false, false, 0, null);
	link.dispatchEvent( event );
}


var encode = function( s ) {
	var out = [];
	for ( var i = 0; i < s.length; i++ ) {
		out[i] = s.charCodeAt(i);
	}
	return new Uint8Array( out );
}


function ViewRender() {
	bongiovi.View.call(this, glslify("../../shaders/render.vert"), glslify("../../shaders/render.frag"));
}

var p = ViewRender.prototype = new bongiovi.View();
p.constructor = ViewRender;

p._init = function() {	
	gl = GL.gl;
	var ps = vertices;

	// var vertexArray = [];
	// for(var i=0; i<ps.length; i++) {
	// 	var v = glm.vec3.clone(ps[i]);
	// 	glm.vec3.normalize(v, v);
	// 	glm.vec3.scale(v, v, params.sphereSize);
	// 	var tmp = [v[0], v[1], v[2]];
	// 	vertexArray.push(tmp);
	// }

	// saveJson(vertexArray);

	var positions    = [];
	var coords       = [];
	var indices      = []; 
	var centers      = [];
	var rotationAxis = [];
	var count        = 0;
	var numParticles = params.numParticles;

	function addVertex(p, uv, center) {
		positions.push(p);
		coords.push(uv);
		centers.push(center);
		indices.push(count);
		count ++;
	}


	for(var i=0; i<ps.length; i+=3) {
		var p0 = vec3.clone(ps[i]);
		var p1 = vec3.clone(ps[i+1]);
		var p2 = vec3.clone(ps[i+2]);

		var pCenter = [ 
						(p0[0]+p1[0]+p2[0])/3.0,
						(p0[1]+p1[1]+p2[1])/3.0,
						(p0[2]+p1[2]+p2[2])/3.0
						];



		var index = i/3;
		var ux = (index % numParticles)/numParticles;
		var uy = Math.floor(index/numParticles)/numParticles;
		var uv = [ux, uy];

		var vACen = vec3.create();
		var vBCen = vec3.create();
		var vCCen = vec3.create();

		vec3.sub(vACen, p0, pCenter);
		vec3.sub(vBCen, p1, pCenter);
		vec3.sub(vCCen, p2, pCenter);
		var scale = 0.65;
		vec3.scale(vACen, vACen, scale);
		vec3.scale(vBCen, vBCen, scale);
		vec3.scale(vCCen, vCCen, scale);

		var p3 = vec3.create();
		var p4 = vec3.create();
		var p5 = vec3.create();
		var p6 = vec3.create();
		var p7 = vec3.create();
		var p8 = vec3.create();

		vec3.sub(p3, pCenter, vACen);
		vec3.sub(p4, pCenter, vBCen);
		vec3.sub(p5, pCenter, vCCen);

		scale = .55;
		vec3.scale(vACen, vACen, scale);
		vec3.scale(vBCen, vBCen, scale);
		vec3.scale(vCCen, vCCen, scale);

		vec3.add(p6, pCenter, vACen);
		vec3.add(p7, pCenter, vBCen);
		vec3.add(p8, pCenter, vCCen);




		addVertex(p0, uv, pCenter);
		addVertex(p1, uv, pCenter);
		addVertex(p2, uv, pCenter);
		addVertex(p3, uv, pCenter);
		addVertex(p4, uv, pCenter);
		addVertex(p5, uv, pCenter);
		addVertex(p6, uv, pCenter);
		addVertex(p7, uv, pCenter);
		addVertex(p8, uv, pCenter);
		addVertex(pCenter, uv, pCenter);
	}


	console.log(positions.length);
	this.positions = positions;
	this.coords    = coords;
	this.centers   = centers;
	this.indices   = indices;

	this.mesh = new bongiovi.Mesh(positions.length, indices.length, GL.gl.POINTS);
	// this.mesh = new bongiovi.Mesh(positions.length, indices.length, GL.gl.TRIANGLES);
	this.mesh.bufferVertex(positions);
	this.mesh.bufferTexCoords(coords);
	this.mesh.bufferIndices(indices);
};
p.render = function(texture) {

	if(!this.mesh) return;

	this.shader.bind();
	this.shader.uniform("texture", "uniform1i", 0);
	this.shader.uniform("size", "uniform1f", params.sphereSize * .8);
	texture.bind(0);
	GL.draw(this.mesh);
};

module.exports = ViewRender;